import React, { useState } from "react";
import FormulaireEquipement from "../composants/FormEquip";
import ListeEquipements from "../composants/ListEquip";

function PageAccueil({ equipements, surAjouter, surReformer, surSupprimer }) {
  return (
    <div>
      <h1>Page d'accueil</h1>
      <FormulaireEquipement surAjouter={surAjouter} />
      <ListeEquipements
        equipements={equipements}
        surReformer={surReformer}
        surSupprimer={surSupprimer}
      />
    </div>
  );
}
export default PageAccueil;
